import React from "react";
import Hero from "../components/Hero";

class BookApp extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      email: "",
      message: "",
      disabled: false,
      emailSent: null,
    };
  }
  render() {
    return (
      <div>
        <Hero title={this.props.title} />
      </div>
    );
  }
}

export default BookApp;
